import React from 'react';
import BookItem from '../BookItem/BookItem';


const DUMMY_BOOKS_LIST = [
    {
        id: '1',
        title: 'Kevade',
        author: 'Oskar Luts',
        year: '1905',
        description: 'instant classic',
        imageUrl: 'https://www.rahvaraamat.ee/images/products/001/234/753/thumbnails/big/7c0e3717085264d56008b738a28e0c3cf9352c77/kevade.jpg'
    }
]


export default function BooksList() {

    return( 
        <ul>
            {DUMMY_BOOKS_LIST.map(book => {
                return <BookItem
                 key = {book.id}
                 title={book.title}
                 author={book.author}
                 year={book.year}
                 imageUrl= {book.imageUrl}
                 description={book.description}
                 />
            })}
        </ul>
    )

}
